import React from 'react';
import './Menu.css';
import { Link } from 'react-router-dom';
const Menu = (props) => (
    <aside>

        <ul id="slide-out" className="sidenav sidenav-fixed">
            <li id="logo">
                <Link to='/' id="logo-container">
                    <img alt='logo' id="img-logo" src={process.env.PUBLIC_URL + '/img/wll.png'} />
                </Link>
            </li>
            <li><Link to='/'>Usuarios</Link></li>
            <li><Link to='/preguntas'>Preguntas</Link></li>
            <li><Link to='/respuestas'>Respuestas</Link></li>
            <li><Link to='/modulos'>Modulos</Link></li>
        </ul>
    </aside>

)

export default Menu;
